import React from "react";
import { useNavigate } from "react-router-dom";
import NavButton from "./NavButton";
import "./nav.css";
import home from "../assets/images/home.svg";
import peers from "../assets/images/peers.svg";
import search from "../assets/images/search.svg";
import notif from "../assets/images/notif.svg";
import profile from "../assets/images/profile.svg";

import peerWhite from "../assets/images/peerWhite.png";





const Nav=(props)=>{

    const navigate=useNavigate();

    const activeHome=()=>{
        if(props.pageName==="home"){
            return "navBtnActive";
        }
        else{
            return "inactive";
        }
    }
    const setHomeLabel=()=>{
        if(props.pageName==="home"){
            return "Home";
        }
        else{
            return "";
        }
    }
    const setPeersLabel=()=>{
        if(props.pageName==="peers"){
            return "Peers";
        }
        else{
            return "";
        }
    }

    const setSearchLabel=()=>{
        if(props.pageName==="search"){
            return "Search";
        }
        else{
            return "";
        }
    }

    const setNotifLabel=()=>{
        if(props.pageName==="notif"){
            return "Notif";
        }
        else{
            return "";
        }
    }

    const setProfileLabel=()=>{
        if(props.pageName==="profile"){
            return "Profile";
        }
        else{
            return "";
        }
    }


    const peersIcon=()=>{
        if(props.page==="peers"){
            return home;
        }
        else{
            return peers;
        }
    }

    const activePeers=()=>{
        if(props.pageName==="peers"){
            return "navBtnActive";
        }
        else{
            return "inactive";
        }
    }
    const activeSearch=()=>{
        if(props.pageName==="search"){
            return "navBtnActive";
        }
        else{
            return "inactive";
        }
    }
    const activeNotif=()=>{
        if(props.pageName==="notif"){
            return "navBtnActive";
        }
        else{
            return "inactive";
        }
    }
    const activeProfile=()=>{
        if(props.pageName==="profile"){
            return "navBtnActive";
        }
        else{
            return "inactive";
        }
    }
    const navigateHome=()=>{
        console.log("Home button clicked");
        navigate("/studentHome");

    }

    const navigatePeers=()=>{
        console.log("Connections button clicked");
        navigate("/studentPeers");
    }

    const navigateSearch=()=>{
        console.log("Search button clicked");
        navigate("/search");
    }

    const navigateNotif=()=>{
        console.log("Notifications button clicked");
        navigate("/notif");
    }

    const navigateProfile=()=>{
        console.log("Profile button clicked");
        navigate("/profile");
    }
    return(
        <nav>
            <ul>
                <li><NavButton className={activeHome()} label={setHomeLabel()} name="homeBtn" icon={home} onClick={navigateHome} /></li>
                <li><NavButton className={activePeers()} label={setPeersLabel()} name="peersBtn" icon={peersIcon()} onClick={navigatePeers}/></li>
                <li><NavButton className={activeSearch()} label={setSearchLabel()} name="searchBtn" icon={search} onClick={navigateSearch} /></li>
                <li><NavButton className={activeNotif()} label={setNotifLabel()} name="notiBtn" icon={notif} onClick={navigateNotif}/></li>
                <li><NavButton className={activeProfile()} label={setProfileLabel()} name="profileBtn" icon={profile} onClick={navigateProfile}/></li>
            </ul>
        </nav>
    )
}
export default Nav;
